import React from "react";
import jsPDF from "jspdf";
import ResumeData from "../ResumeData";
const Resume = () => {
  {
    ResumeData.map((val, index) => {
      return (
        <div key={index}>
          {/* key={index} */}
          {/* console.log("inside resume") */}
          <a target="_blank" href={val.doc} />
        </div>
      );
    });
  }
};

// <section id="app">
//   <div id="resume" className="Resume">
//     <div className="heading">WELCOME TO MY RESUME PAGE</div>
//   </div>
// </section>

export default Resume;
